// Helper functions for template
func getUserStatusColor(status string) string {
	switch status {
	case "active":
		return "success"
	case "inactive":
		return "warning"
	case "suspended":
		return "danger"
	default:
		return "secondary"
	}
}

func countActiveUsers(users []dash.ObjectStoreUser) int {
	count := 0
	for _, user := range users {
		if user.Status == "active" {
			count++
		}
	}
	return count
}

